INSERT INTO `interview` VALUES (11,'호이스팅은 변수와 함수 선언이 스코프(scope)의 최상단으로 올려져 실행되는 것을 의미하며, 이로 인해 선언 전에 사용하는 경우 오류가 발생할 가능성이 존재합니다.','언어','호이스팅(Hoisting)에 대해서 설명해주세요.','Javascript'),(12,'동기는 요청을 보낸 후 기다렸다가 해당 응답을 받아야 다음 동작을 수행하고, 비동기는 요청을 보낸 후 응답을 기다리지 않고 다음 동작을 수행합니다.','언어','Sync와 Async의 차이점을 설명해주세요.','Javascript'),(13,'콜백 함수는 전달인자로 다른 함수에 전달되는 함수로 매개변수로 함수 객체를 전달해서 호출 함수 내에서 매개변수 함수를 실행하는 것을 의미합니다.','언어','콜백함수에 대해 설명해주세요.','Javascript'),(14,'async/await 문법에서는 try...catch문으로 에러 처리가 가능하지만 Promise문은 불가능! 프로미스를 반환하는 비동기 함수는 명시적으로 호출이 가능해서, 호출자가 명확하기 때문에 try catch 문으로 에러를 처리할 수 있고, 최종적으로 catch 문에서 에러를 출력하는 Promise와 달리 쉽게 문제가 발생한 부분을 찾을 수 있다는 장점도 존재합니다.','언어','Promise를 이용한 비동기 통신과 Async, Await를 사용한 비동기 통신의 차이를 설명해주세요.','Javascript'),(15,'자신이 속한 객체 또는 자신이 생성할 인스턴스를 가리키는 자기 참조 변수로서 함수의 호출 방식에 따라 특정 객체를 바인딩합니다.','언어','this의 의미를 설명해주세요.','Javascript'),(16,'이벤트가 발생한 요소부터 점점 부모 요소를 거슬러 올라가서 window까지 이벤트를 전파하는 것입니다.','언어','이벤트 버블링에 대해 설명해주세요.','Javascript'),(17,'얕은 복사는 객체의 참조값(주소)를 복사하는 것이고 깊은 복사는 새로운 메모리 공간을 확보하여 객체의 값 자체를 복사하는 것입니다.','언어','깊은 복사와 얕은 복사의 차이점을 설명해주세요.','Javascript'),(18,'브라우저가 가지고 있는 XMLHttpRequest 객체를 이용해서 서버와 브라우저가 비동기 방식으로 데이터를 교환할 수 있는 통신 기능입니다.','언어','Ajax에 대해서 설명해주세요.','Javascript'),(19,'mutable은 변경 가능한 변수의 유형으로 해당 데이터의 주소를 찾아서 값을 변경하고, immutable은 변경 불가능한 변수의 유형으로 해당 데이터 주소와 별개의 새로운 주소에 값이 할당됩니다.','언어','mutable과 immutable에 대해 설명해주세요.','Javascript'),(20,'call stack이 다 비워지면 callback queue에 존재하는 함수를 하나씩 call stack으로 옮기는 역할을 합니다.','언어','Event Loop에 대해서 설명해주세요.','Javascript'),(21,'다형성은 객체 지향 프로그래밍의 주요 특징 중 하나로, 같은 이름의 메서드나 연산자가 여러 클래스에서 다른 방식으로 작동할 수 있는 것을 의미합니다. 이는 상속(inheritance)을 통해 구현될 수 있으며, 메서드 오버라이딩(method overriding)과 메서드 오버로딩(method overloading)을 통해 구현됩니다.','언어','다형성(polymorphism)이란 무엇인가요?','Java'),(22,'추상 클래스는 일부 메서드가 구현되어 있고 일부 메서드가 추상 메서드로 선언된 클래스입니다. 반면에, 인터페이스는 모든 메서드가 추상 메서드로 선언된 인터페이스입니다. 클래스는 여러 인터페이스를 구현할 수 있지만 오직 하나의 추상 클래스만을 상속할 수 있습니다.','언어','추상 클래스(abstract class)와 인터페이스(interface)의 차이는 무엇인가요?','Java'),(23,'Garbage Collection은 동적으로 할당된 메모리에서 더 이상 사용되지 않는 객체를 자동으로 파괴하고 메모리를 회수하는 프로세스입니다. Java에서는 Garbage Collector가 주기적으로 메모리를 검사하여 사용되지 않는 객체를 식별하고 제거합니다.','언어','Garbage Collection이란 무엇이며 어떻게 작동하나요','Java'),(24,'스레드는 프로세스 내에서 실행되는 경량 프로세스입니다. Java에서는 java.lang.Thread 클래스를 확장하거나 java.lang.Runnable 인터페이스를 구현함으로써 스레드를 구현할 수 있습니다.','언어','스레드(thread)란 무엇이며, 어떻게 구현할 수 있나요?','Java'),(25,'Java에서는 try-catch-finally 블록을 사용하여 예외를 처리합니다. try 블록 내에서 예외가 발생할 수 있는 코드를 작성하고, catch 블록에서 예외를 처리하거나 finally 블록에서 리소스를 정리할 수 있습니다.','언어','Java에서 예외(exception) 처리 방법은 무엇인가요?','Java'),(26,'컬렉션 프레임워크는 데이터를 저장하고 관리하기 위한 인터페이스와 클래스의 모음입니다. 주요 인터페이스로는 List, Set, Map이 있으며, 각각의 인터페이스에 대응하는 클래스로는 ArrayList, LinkedList, HashSet, HashMap 등이 있습니다.','언어','컬렉션(collection) 프레임워크란 무엇이며 주요 인터페이스와 클래스는 어떤 것이 있나요?','Java'),(27,'지역 변수는 메서드 내에서 선언되어 해당 메서드 내에서만 사용되는 변수입니다. 인스턴스 변수는 클래스 내에서 선언되어 객체의 인스턴스마다 별도의 값이 유지되는 변수이며, 클래스 변수는 클래스 내에서 static 키워드로 선언되어 클래스의 모든 인스턴스에 대해 동일한 값이 유지되는 변수입니다.','언어','지역 변수(local variable), 인스턴스 변수(instance variable), 클래스 변수(class variable)의 차이는 무엇인가요?','Java'),(28,'상속은 하위 클래스가 상위 클래스의 특성과 동작을 상속받는 것을 의미합니다. 반면에, 구성은 하나의 클래스가 다른 클래스의 인스턴스를 포함하는 것을 의미합니다. 상속은 is-a 관계를 모델링할 때 사용되고, 구성은 has-a 관계를 모델링할 때 사용됩니다.','언어','상속(inheritance)과 구성(composition)의 차이는 무엇인가요?','Java'),(29,'직렬화는 객체를 바이트 스트림으로 변환하는 과정을 의미하고, 역직렬화는 바이트 스트림을 다시 객체로 변환하는 과정을 의미합니다. Java에서는 Serializable 인터페이스를 구현하여 직렬화와 역직렬화를 지원합니다.','언어','직렬화(serialization)와 역직렬화(deserialization)란 무엇인가요?','Java'),(30,'제네릭스는 클래스나 메서드가 여러 데이터 유형에 대해 작동할 수 있도록 일반화된 유형을 제공하는 Java의 기능입니다. 제네릭스를 사용하면 컴파일 시간에 타입 안정성을 보장할 수 있습니다. 제네릭스는 클래스, 인터페이스, 메서드 등에서 사용할 수 있습니다.','언어','제네릭스(generics)가 무엇이며 어떻게 사용하나요?','Java'),(31,'다형성은 객체 지향 프로그래밍의 주요 특징 중 하나로, 같은 이름의 메서드나 연산자가 여러 클래스에서 다른 방식으로 작동할 수 있는 것을 의미합니다. 파이썬에서는 다형성이 동적으로 처리되므로 특정한 형식의 상속이나 인터페이스 구현 없이도 다형성을 활용할 수 있습니다.','언어','다형성(polymorphism)이란 무엇인가요?','Python'),(32,'파이썬에서는 제네릭스를 명시적으로 지원하지 않습니다. 하지만 파이썬의 동적 타이핑(dynamic typing)과 다형성을 통해 유사한 기능을 구현할 수 있습니다.','언어','제네릭스(generics)가 무엇이며 어떻게 사용하나요?','Python'),(33,'파이썬에서는 try-except 블록을 사용하여 예외를 처리합니다. try 블록 내에서 예외가 발생할 수 있는 코드를 작성하고, except 블록에서 예외를 처리합니다. 또한 else 블록을 사용하여 예외가 발생하지 않았을 때의 코드를 실행할 수 있습니다.','언어','예외(exception) 처리 방법은 무엇인가요?','Python'),(34,'파이썬에서는 제네릭스를 명시적으로 지원하지 않습니다. 하지만 제네릭스를 대체하기 위해 타입 힌트(type hints)와 데코레이터(decorators)를 사용하여 비슷한 효과를 얻을 수 있습니다.','언어','파이썬에서의 제네릭스(generics)가 무엇이며 어떻게 사용하나요?','Python'),(35,'반복 가능한 객체는 요소를 한 번에 하나씩 제공할 수 있는 객체이며, 반복자는 이러한 요소를 차례로 제공하는 객체입니다. 파이썬에서는 반복 가능한 객체는 __iter__() 메서드를, 반복자는 __next__() 메서드를 구현하여야 합니다.','언어','반복 가능한(iterable) 객체와 반복자(iterator)의 차이는 무엇인가요?','Python'),(36,'리스트는 변경 가능한(mutable) 시퀀스 자료형이며, 요소를 추가하거나 제거할 수 있습니다. 반면에, 튜플은 변경 불가능한(immutable) 시퀀스 자료형이며, 한 번 생성되면 요소를 변경할 수 없습니다. 리스트는 대괄호 []로, 튜플은 소괄호 ()로 표현됩니다.','언어','파이썬에서의 리스트(list)와 튜플(tuple)의 차이는 무엇인가요?','Python'),(37,'파이썬에서는 제네릭스를 명시적으로 지원하지 않습니다. 하지만 파이썬은 동적 타이핑(dynamic typing)을 지원하므로 동일한 함수나 클래스를 여러 데이터 유형에 대해 사용할 수 있습니다. 이를 통해 제네릭스와 비슷한 효과를 얻을 수 있습니다.','언어','제네릭스(generics)가 무엇이며 어떻게 사용하나요?','Python'),(38,'람다 함수는 익명의 함수를 생성하는 방법 중 하나로, 한 줄로 간단하게 함수를 정의할 수 있습니다. 주로 함수의 인자로 전달되거나 간단한 연산을 수행할 때 사용됩니다.','언어','파이썬에서의 람다(lambda) 함수는 무엇이며 어떻게 사용하나요?','Python'),(39,'컴프리헨션은 반복문과 조건문을 사용하여 컬렉션을 생성하는 간결한 방법입니다. 리스트 컴프리헨션, 딕셔너리 컴프리헨션, 집합 컴프리헨션 등 다양한 형태가 있으며, 파이썬의 강력한 기능 중 하나입니다.','언어','파이썬에서의 컴프리헨션(comprehension)은 무엇이며 어떻게 사용하나요?','Python'),(40,'ReactJS는 사용자 인터페이스를 구축하기 위한 JavaScript 라이브러리입니다. React는 컴포넌트 기반 아키텍처를 사용하여 UI를 구성하고, 가상 DOM(virtual DOM)을 활용하여 성능을 최적화합니다. 컴포넌트는 상태(state)와 속성(props)을 통해 데이터를 관리하고 UI를 렌더링합니다.','프론트엔드','ReactJS는 무엇이며 어떻게 작동하나요?','ReactJS'),(41,'상태(state)는 컴포넌트 내에서 관리되는 변경 가능한 데이터이며, 컴포넌트 내부에서 변경될 수 있습니다. 반면에 속성(props)은 부모 컴포넌트로부터 전달되는 읽기 전용 데이터이며, 컴포넌트 내에서 변경할 수 없습니다.','프론트엔드','React 컴포넌트에서 상태(state)와 속성(props)의 차이는 무엇인가요?','ReactJS'),(42,'React에서 이벤트는 JSX 문법을 사용하여 처리됩니다. 이벤트 핸들러는 JSX 요소의 속성으로 전달되며, 이벤트가 발생할 때 실행될 함수를 지정합니다. 일반적으로 이벤트 핸들러 함수는 화살표 함수로 작성됩니다.','프론트엔드','React에서 이벤트 처리 방법은 무엇인가요?','ReactJS'),(43,'React에서 조건부 렌더링은 JavaScript의 조건문을 사용하여 구현됩니다. 삼항 연산자나 && 연산자를 사용하여 조건에 따라 다른 JSX 요소를 반환할 수 있습니다.','프론트엔드','ReactJS에서의 조건부 렌더링은 어떻게 구현하나요?','ReactJS'),(44,'React 컴포넌트는 마운트, 업데이트, 언마운트 단계에서 다양한 생명주기 메서드를 가집니다. 마운트 단계에서는 constructor, render, componentDidMount 등의 메서드가 호출되며, 업데이트 단계에서는 shouldComponentUpdate, componentDidUpdate 등의 메서드가 호출됩니다. 언마운트 단계에서는 componentWillUnmount 메서드가 호출됩니다.','프론트엔드','React의 생명주기(lifecycle) 메서드에 대해 설명해주세요.','ReactJS'),(45,'React Hooks는 함수 컴포넌트에서 상태(state)와 생명주기(lifecycle) 메서드를 사용할 수 있도록 하는 기능입니다. useState, useEffect 등의 내장 훅을 사용하여 상태를 관리하고 부수 효과를 처리할 수 있습니다.','프론트엔드','React Hooks는 무엇이며 어떻게 사용하나요?','ReactJS'),(46,'React에서 라우팅은 보통 react-router 라이브러리를 사용하여 구현됩니다. react-router를 사용하면 브라우저의 주소와 해당하는 컴포넌트를 매핑할 수 있으며, 사용자가 주소를 변경할 때마다 적절한 컴포넌트가 렌더링됩니다.','프론트엔드','React에서의 라우팅(routing)은 어떻게 구현하나요?','ReactJS'),(47,'React 컴포넌트 간의 통신은 props를 통해 이루어집니다. 부모 컴포넌트에서 자식 컴포넌트로 데이터를 전달할 때는 props를 사용하고, 자식 컴포넌트에서 부모 컴포넌트로 이벤트를 전달할 때는 콜백 함수를 props로 전달합니다.','프론트엔드','React 컴포넌트 간의 통신 방법은 무엇인가요?','ReactJS'),(48,'React의 가상 DOM은 메모리 상에 존재하는 가상의 트리 구조로, 실제 DOM과 동기화되어 화면에 렌더링됩니다. React는 상태(state)가 변경될 때마다 가상 DOM을 업데이트하고 이전과 비교하여 변경된 부분만 실제 DOM에 반영합니다.','프론트엔드','React의 가상 DOM(virtual DOM)은 무엇이며 어떻게 동작하나요?','ReactJS'),(49,'React의 키는 엘리먼트 목록을 렌더링할 때 각 엘리먼트가 고유하다는 것을 React에게 알려주는 역할을 합니다. 키를 사용하면 React가 엘리먼트의 변경을 효율적으로 추적할 수 있으며, 리스트의 순서가 변경되어도 적절한 엘리먼트를 업데이트할 수 있습니다.','프론트엔드','React의 키(key)는 무엇이며 어떻게 사용하나요?','ReactJS'),(50,'Vue.js는 사용자 인터페이스를 구축하기 위한 프로그레시브 프레임워크입니다. Vue는 데이터와 DOM을 연결하여 화면을 동적으로 업데이트할 수 있는 반응형 시스템을 제공합니다. 또한 가상 DOM(virtual DOM)을 활용하여 성능을 최적화합니다.','프론트엔드','Vue.js는 무엇이며 어떻게 작동하나요?','VueJS'),(51,'Vue 컴포넌트는 생성, 갱신, 제거 등의 단계에서 다양한 생명주기 훅을 가집니다. 생성 단계에서는 beforeCreate, created, beforeMount 등의 훅이 호출되며, 갱신 단계에서는 beforeUpdate, updated 훅이 호출됩니다. 제거 단계에서는 beforeDestroy, destroyed 훅이 호출됩니다.','프론트엔드','Vue 컴포넌트에서 생명주기(lifecycle) 훅에는 어떤 것들이 있나요?','VueJS'),(52,'Vue에서 이벤트는 v-on 디렉티브를 사용하여 처리됩니다. 이 디렉티브를 사용하여 DOM 이벤트를 감지하고 처리할 수 있습니다. 또한 메서드 호출이나 표현식 실행 등을 사용하여 이벤트 핸들러를 정의할 수 있습니다.','프론트엔드','Vue에서의 이벤트 처리 방법은 무엇인가요?','VueJS'),(53,'Vue에서 조건부 렌더링은 v-if, v-else-if, v-else 디렉티브를 사용하여 구현됩니다. 이 디렉티브를 사용하여 조건에 따라 특정 부분의 DOM 요소를 렌더링하거나 숨길 수 있습니다.','프론트엔드','Vue에서의 조건부 렌더링은 어떻게 구현하나요?','VueJS'),(54,'Vue에서 반복 렌더링은 v-for 디렉티브를 사용하여 구현됩니다. 이 디렉티브를 사용하여 배열이나 객체의 각 항목을 순회하고 템플릿을 반복하여 렌더링할 수 있습니다.','프론트엔드','Vue에서의 반복 렌더링은 어떻게 구현하나요?','VueJS'),(55,'Vue에서 컴포넌트 간의 통신은 props와 이벤트를 사용하여 이루어집니다. 부모 컴포넌트에서 자식 컴포넌트로 데이터를 전달할 때는 props를 사용하고, 자식 컴포넌트에서 부모 컴포넌트로 이벤트를 전달할 때는 이벤트를 발생시킵니다.','프론트엔드','Vue에서 컴포넌트 간의 통신 방법은 무엇인가요?','VueJS'),(56,'Vue에서 라우팅은 보통 Vue Router를 사용하여 구현됩니다. Vue Router를 사용하면 브라우저의 주소와 해당하는 컴포넌트를 매핑할 수 있으며, 사용자가 주소를 변경할 때마다 적절한 컴포넌트가 렌더링됩니다.','프론트엔드','Vue에서의 라우팅(routing)은 어떻게 구현하나요?','VueJS'),(57,'Vue에서 상태 관리는 주로 Vuex 라이브러리를 사용하여 구현됩니다. Vuex는 중앙 집중식 상태 저장소를 제공하며, 컴포넌트 간에 상태를 공유하고 관리할 수 있습니다.','프론트엔드','Vue에서의 상태 관리 방법은 무엇인가요?','VueJS'),(58,'Vue에서 스타일은 일반적으로 객체 형식으로 지정됩니다. 컴포넌트의 스타일 속성에 객체를 전달하여 스타일을 지정하거나, CSS 모듈을 사용하여 컴포넌트별로 스타일을 관리할 수 있습니다.','프론트엔드','Vue에서의 스타일 지정 방법은 무엇인가요?','VueJS'),(59,'Vue에서 비동기 처리는 주로 Promise나 async/await를 사용하여 구현됩니다. 비동기 작업을 처리하는 메서드나 함수는 Promise 객체를 반환하고, 비동기 작업이 완료될 때까지 대기하거나 then 메서드나 await 키워드를 사용하여 처리할 수 있습니다.','프론트엔드','Vue에서의 비동기 처리 방법은 무엇인가요?','VueJS'),(60,'NextJS는 React 기반의 프레임워크로, 서버 사이드 렌더링(SSR), 정적 사이트 생성(SSG), 코드 분할 등의 기능을 지원합니다.','프론트엔드','NextJS의 주요 특징은 무엇인가요?','NextJS'),(61,'NextJS에서는 pages 디렉토리 내의 파일 기반 라우팅을 제공합니다. 각 파일은 해당 경로에 대응되며, 파일 이름이 URL 경로가 됩니다.','프론트엔드','NextJS에서의 파일 기반 라우팅은 어떻게 작동하나요?','NextJS'),(62,'NextJS에서는 getStaticProps 또는 getServerSideProps 함수를 사용하여 데이터를 가져올 수 있습니다.','프론트엔드','NextJS에서 데이터를 가져오는 방법은 무엇인가요?','NextJS'),(63,'NextJS에서는 동적 임포트(dynamic import)를 사용하여 코드 분할을 구현합니다. 페이지나 컴포넌트가 필요한 시점에 해당 모듈을 가져오므로 초기 로딩 시간을 줄일 수 있습니다.','프론트엔드','NextJS에서의 코드 분할은 어떻게 이루어지나요?','NextJS'),(64,'NextJS에서는 Link 컴포넌트를 사용하여 페이지 간 이동을 구현할 수 있습니다. Link 컴포넌트를 사용하면 클라이언트 측 네비게이션을 통해 페이지를 즉시 로드할 수 있습니다.','프론트엔드','NextJS에서의 라우팅을 사용하여 페이지 간 이동은 어떻게 할 수 있나요?','NextJS'),(65,'NextJS에서는 CSS 모듈, CSS-in-JS, 외부 CSS 파일을 사용하여 스타일링을 할 수 있습니다. 각각의 방법은 프로젝트의 요구 사항에 따라 선택할 수 있습니다.','프론트엔드','NextJS에서의 CSS 스타일링 방법은 무엇인가요?','NextJS'),(66,'NextJS에서는 커스텀 에러 페이지를 만들어 에러 핸들링을 할 수 있습니다. 또한 API 라우트에서도 에러 핸들링이 가능합니다.','프론트엔드','NextJS에서의 에러 핸들링은 어떻게 이루어지나요?','NextJS'),(67,'NextJS에서는 .env 파일을 통해 환경 변수를 설정하고 process.env 객체를 통해 사용할 수 있습니다.','프론트엔드','NextJS에서의 환경 변수 사용 방법은 무엇인가요?','NextJS'),(68,'NextJS에서는 빌드 명령을 사용하여 프로덕션용 번들을 생성하고, 배포는 정적 호스팅 서비스를 사용하거나 서버리스 플랫폼에 배포할 수 있습니다.','프론트엔드','NextJS에서의 빌드 및 배포 방법은 무엇인가요?','NextJS'),(69,'NextJS에서는 페이지의 메타 태그를 설정하여 SEO를 최적화할 수 있습니다. 또한 정적 사이트 생성 기능을 사용하여 사전 렌더링된 HTML을 제공할 수 있습니다.','프론트엔드','NextJS에서의 SEO 최적화 방법은 무엇인가요?','NextJS'),(70,'Spring은 자바 기반의 오픈 소스 프레임워크로, 엔터프라이즈급 애플리케이션을 개발하기 위한 다양한 기능과 모듈을 제공합니다.','백엔드','Spring 프레임워크란 무엇인가요?','Spring'),(71,'Spring의 핵심 기능에는 의존성 주입(Dependency Injection), 관점 지향 프로그래밍(Aspect-Oriented Programming), 템플릿 기반 프로그래밍, 제어 역행(Inversion of Control) 등이 있습니다.','백엔드','Spring의 핵심 기능은 무엇인가요?','Spring'),(72,'의존성 주입은 객체가 필요로 하는 의존 객체를 직접 생성하는 대신, 외부에서 주입하여 사용하는 디자인 패턴입니다. Spring은 이를 통해 객체 간의 결합도를 낮추고 유연한 애플리케이션을 만들 수 있도록 지원합니다.','백엔드','Spring의 의존성 주입(Dependency Injection)이란 무엇인가요?','Spring'),(73,'AOP는 관점 지향 프로그래밍의 약자로, 흩어진 관심사를 모듈화하여 코드 중복을 줄이고 관심사의 분리를 지원하는 프로그래밍 패러다임입니다. Spring은 AOP를 사용하여 보안, 로깅, 트랜잭션 관리 등을 구현할 수 있습니다.','백엔드','Spring에서의 AOP(Aspect-Oriented Programming)은 무엇인가요?','Spring'),(74,'Spring MVC는 Model, View, Controller의 약자로, 웹 애플리케이션을 개발할 때 사용되는 아키텍처 패턴입니다. Model은 애플리케이션의 비즈니스 로직을 처리하고, View는 사용자에게 데이터를 보여주는 역할을 하며, Controller는 클라이언트 요청을 처리하고 적절한 응답을 생성합니다.','백엔드','Spring에서의 MVC 아키텍처는 무엇인가요?','Spring'),(75,'Spring은 선언적 트랜잭션 관리를 지원합니다. @Transactional 애노테이션을 사용하여 트랜잭션 경계를 정의하고, 필요한 메서드에 적용할 수 있습니다. 또한 XML 설정 파일을 통해 트랜잭션 속성을 세밀하게 제어할 수도 있습니다.','백엔드','Spring에서의 트랜잭션 관리는 어떻게 이루어지나요?','Spring'),(76,'Spring Security를 사용하여 인증(Authentication)과 권한 부여(Authorization)를 구현할 수 있습니다. Spring Security는 다양한 인증 방법과 권한 검사 기능을 제공하여 보안을 강화할 수 있습니다.','백엔드','Spring에서의 보안 기능은 어떻게 구현되나요?','Spring'),(77,'Spring은 @RestController 애노테이션을 사용하여 RESTful 웹 서비스를 개발할 수 있습니다. 또한 Spring Boot를 사용하면 간편하게 RESTful 웹 서비스를 개발하고 배포할 수 있습니다.','백엔드','Spring에서의 RESTful 웹 서비스 개발 방법은 무엇인가요?','Spring'),(78,'Spring은 다양한 캐시 추상화 기능을 제공하여 캐시 처리를 간편하게 할 수 있습니다. @Cacheable, @CacheEvict, @CachePut 애노테이션을 사용하여 메서드의 결과를 캐시에 저장하고 관리할 수 있습니다.','백엔드','Spring에서의 캐시 처리는 어떻게 이루어지나요?','Spring'),(79,'Spring은 JDBC, JPA, MyBatis 등 다양한 방법으로 데이터베이스 연동을 지원합니다. DataSource 설정, EntityManager 설정, SqlSessionFactory 설정 등을 통해 데이터베이스와의 연동을 구현할 수 있습니다.','백엔드','Spring에서의 데이터베이스 연동은 어떻게 이루어지나요?','Spring'),(80,'Spring은 JUnit, Mockito, Spring Test 등 다양한 테스트 프레임워크와 라이브러리를 제공합니다. @Test 애노테이션을 사용하여 단위 테스트부터 통합 테스트까지 다양한 테스트를 수행할 수 있습니다.','백엔드','Spring에서의 테스트 방법은 무엇인가요?','Spring'),(81,'Node.js는 Chrome V8 JavaScript 엔진으로 빌드된 JavaScript 런타임 환경으로, 비동기 이벤트 기반의 서버 사이드 플랫폼입니다.','백엔드','Node.js는 무엇인가요?','NodeJS'),(82,'Node.js의 주요 특징에는 비동기 I/O 처리, 단일 스레드 이벤트 루프, 모듈 시스템, 높은 성능 등이 있습니다.','백엔드','Node.js의 주요 특징은 무엇인가요?','NodeJS'),(83,'Node.js는 이벤트 루프를 통해 비동기 I/O 작업을 처리합니다. 이벤트 루프는 이벤트 큐에 있는 작업을 순회하면서 비동기 작업의 완료를 확인하고, 완료된 작업에 대한 콜백을 실행합니다.','백엔드','Node.js에서의 이벤트 루프는 어떻게 작동하나요?','NodeJS'),(84,'Node.js에서는 CommonJS 모듈 시스템을 사용하여 모듈을 정의하고 사용합니다. 모듈은 require 함수를 사용하여 불러오며, module.exports나 exports 객체를 사용하여 내보낼 수 있습니다.','백엔드','Node.js에서의 모듈 시스템은 어떻게 구성되나요?','NodeJS'),(85,'Node.js는 비동기 I/O 처리를 통해 단일 스레드로 많은 요청을 처리할 수 있습니다. 비동기 함수나 이벤트를 통해 I/O 작업이 완료될 때까지 블로킹되지 않고 다음 작업을 수행합니다.','백엔드','Node.js에서의 비동기 I/O 처리는 어떻게 이루어지나요?','NodeJS'),(86,'Node.js에서는 npm(Node Package Manager)을 사용하여 패키지를 관리합니다. npm을 통해 패키지를 설치하고 관리할 수 있으며, package.json 파일을 통해 프로젝트의 의존성을 관리합니다.','백엔드','Node.js에서의 패키지 관리는 어떻게 이루어지나요?','NodeJS'),(87,'Express.js는 Node.js를 위한 웹 애플리케이션 프레임워크로, 간결하고 유연한 기능을 제공합니다. Express.js를 사용하여 라우팅, 미들웨어, 템플릿 엔진 등을 구현할 수 있습니다.','백엔드','Node.js에서의 Express.js는 무엇이며 어떻게 사용하나요?','NodeJS'),(88,'Node.js에서는 다양한 데이터베이스를 연동할 수 있습니다. 주로 사용되는 것은 MongoDB, MySQL, PostgreSQL 등이며, 각 데이터베이스에 맞는 드라이버를 사용하여 연동합니다.','백엔드','Node.js에서의 데이터베이스 연동은 어떻게 이루어지나요?','NodeJS'),(89,'Node.js에서 주의해야 할 보안 취약점에는 콜백 지옥(callback hell), 비정상적인 입력 검증, 취약한 의존성, 인증 및 권한 부여 등이 있습니다.','백엔드','Node.js에서의 보안 취약점은 무엇이 있나요?','NodeJS'),(90,'Node.js의 성능을 향상시키기 위해 클러스터링, 로드 밸런싱, 캐싱, 코드 최적화, 비동기 프로그래밍 등의 방법을 사용할 수 있습니다.','백엔드','Node.js에서의 성능 향상을 위한 방법은 무엇이 있나요?','NodeJS');
