INSERT INTO `ox_quiz` VALUES (41,_binary '','Java','Java에서 클래스와 클래스의 인스턴스를 생성하기 위해 사용하는 키워드는 \'new\'이다.'),(42,_binary '','Java','Java에서 변수를 선언할 때, \'null\' 키워드를 사용하여 메모리에 공간을 할당하고 초기화하지 않은 상태로 만들 수 있다.'),(43,_binary '\0','Java','Java에서 문자열을 다루기 위한 내장 클래스는 \'Char\'이다.'),(44,_binary '','Java','객체 지향 프로그래밍(OOP)에서 객체 간의 의사 소통을 위해 사용되는 프로토콜은 \'인터페이스\'이다.'),(45,_binary '','Java','Java에서 다른 클래스의 모든 멤버에 접근을 허용하도록 하는 키워드는 \'public\'이다.'),(46,_binary '','Java','객체가 여러 가지 형태를 가질 수 있는 특성을 \'다형성\'이라고 한다.'),(47,_binary '\0','Java','컴파일러가 메소드 호출 시에 어떤 메소드를 호출할 것인지를 판별하는 프로세스를 \'오버라이딩\'이라고 한다.'),(48,_binary '','Java','Java에서 일부 메서드가 구현되지 않은 클래스를 \'추상클래스\'라고 한다.'),(49,_binary '\0','Java','Java에서 상속을 받은 하위 클래스에서 부모 클래스의 메소드를 재정의하는 것을 \'오버로딩\'이라고 한다.'),(50,_binary '','Java','객체의 상태와 행위를 함께 묶고 외부에서 접근을 제어하는 것을 \'캡슐화\'라고 한다.'),(51,_binary '','Python','파이썬에서 변수의 자료형을 확인하는 함수는 \'type()\'이다.'),(52,_binary '','Python','파이썬에서 여러 개의 요소를 갖는 자료형은 \'list\'이다.'),(53,_binary '\0','Python','파이썬에서 반복문을 한 번에 벗어날 때 사용하는 키워드는 \'return\'이다.'),(54,_binary '\0','Python','파이썬에서 조건문을 사용하여 여러 조건 중 하나에 해당하는 경우를 처리하는 키워드는 \'else if\'이다.'),(55,_binary '\0','Python','파이썬에서 함수를 정의할 때 사용하는 키워드는 \'function\' 이다.'),(56,_binary '','Python','파이썬에서 리스트에서 특정 값을 찾아 해당하는 모든 인덱스를 반환하는 함수는 \'index()\'이다.'),(57,_binary '','Python','파이썬에서 특정 범위의 숫자를 생성하여 반환하는 함수는 \'range()\'이다.'),(58,_binary '','Python','파이썬에서 두 개의 자료구조를 병합하는 함수는 \'extend()\'이다.'),(59,_binary '\0','Python','파이썬에서 리스트에서 마지막 요소를 제거하고 반환하는 함수는 \'push()\'이다.'),(60,_binary '','Python','파이썬에서 정수형 자료를 실수형으로 변환하는 함수는 \'float()\'이다.'),(61,_binary '','Javascript','변수와 함수 선언이 스코프의 최상단으로 올려져 실행되는 것을 \'호이스팅\'이라고 한다.'),(62,_binary '','Javascript','\'const 변수\'는 중복선언과 재할당이 불가능하고, 변수를 선언하기 전에 참조할 수 없다.'),(63,_binary '\0','Javascript','이벤트가 발생한 요소부터 점점 부모 요소를 거슬러 올라가서 window까지 이벤트를 전파하는 것을 \'이벤트 캡쳐링\'이라고 한다.'),(64,_binary '\0','Javascript','\'let 변수\'는 중복선언과 재할당이 가능하고, 변수를 선언하기 전에 참조가 가능하다.'),(65,_binary '\0','Javascript','\'async 작업\'은 요청을 보낸 후 응답을 기다렸다가 해당 응답을 받아야 다음 동작을 수행한다.'),(66,_binary '\0','Javascript','데이터 자체를 복사하지 않고 해당 데이터의 참조값을 전달하여 하나의 데이터를 공유하는 것은 \'얕은 복사\'에 대한 설명이다.'),(67,_binary '','Javascript','브라우저가 가지고 있는 XMLHttpRequest 객체를 이용해서 서버와 브라우저가 비동기 방식으로 데이터를 교환할 수 있는 통신기능을 \'Ajax\'라고 한다.'),(68,_binary '','Javascript','화살표 함수 안에서 this는 선언될 당시에 상위 실행 문맥, 그 스코프에 해당하는 실행 문맥 상의 this 바인딩 컴포넌트를 참조한다.'),(69,_binary '','Javascript','콜 스택과 콜백 큐를 감시하는 역할로 콜백 큐에 함수가 존재하고 콜 스택이 비었다면 콜백 큐에서 콜백을 꺼내 콜 스택에 넣어주는 역할을 하는 것은 \'이벤트 루프\'이다.'),(70,_binary '','Javascript','자바스크립트는 싱글 스레드 기반 언어이다.'),(71,_binary '\0','TypeScript','TypeScript에서 정수형 데이터 타입을 나타내는 키워드는 무엇입니까 \'num\'이다.'),(72,_binary '','TypeScript','TypeScript에서 변수의 타입을 유연하게 변경할 수 있는 키워드는 \'any\'이다.'),(73,_binary '','TypeScript','TypeScript에서 함수의 반환 타입을 명시적으로 지정하지 않으면 자동으로 할당되는 타입은 \'void\'이다.'),(74,_binary '\0','TypeScript','TypeScript에서 타입 단언을 사용하여 컴파일러에게 해당 변수의 타입을 개발자가 확신시킬 수 있습니다. 이를 위해 사용하는 키워드는 \'assertion\'이다.'),(75,_binary '\0','TypeScript','TypeScript에서 구조적 타이핑을 지원하는 것은 \'class\'이다.'),(76,_binary '','TypeScript','TypeScript에서 타입 추론(Type Inference)은 개발자가 변수의 타입을 명시적으로 선언하지 않아도 컴파일러가 해당 변수의 타입을 추론할 수 있는 기능입니다. 이는 코드의 가독성을 향상시킬 수 있다.'),(77,_binary '\0','TypeScript','TypeScript에서 함수의 매개변수 또는 반환값의 타입이 여러 개일 경우, 이를 하나의 타입으로 정의하기 위해 사용되는 문법은 \'Intersection Type\'이다.'),(78,_binary '','TypeScript','TypeScript에서 생성자 함수 \'constructor()\'를 이용하여 클래스의 멤버 변수를 초기화 할 수 있다.'),(79,_binary '','TypeScript','TypeScript에서 다른 클래스나 인터페이스를 상속받을 때 사용되는 키워드는 \'extends\'이다.'),(80,_binary '\0','TypeScript','TypeScript에서 어떤 변수가 특정한 타입인지 확인하는 연산자 \'instanceOf\'이다. '),(81,_binary '','ReactJS','React는 자바스크립트 라이브러리이다.'),(82,_binary '','ReactJS','React에서 상태(state)를 변경하기 위해서는 setState() 메서드를 사용한다.'),(83,_binary '','ReactJS','React 컴포넌트의 렌더링 결과는 브라우저의 DOM 요소가 아니라 가상 DOM에 반영된다.'),(84,_binary '\0','ReactJS','React는 단방향 데이터 바인딩을 지원하지 않는다.'),(85,_binary '','ReactJS','React 컴포넌트에서 Props는 읽기 전용(Read-only)이다.'),(86,_binary '','ReactJS','React는 페이스북에서 개발된 오픈 소스 프로젝트이다.'),(87,_binary '','ReactJ