INSERT INTO `sub_question` VALUES (1,'네이버','\n빅데이터를 사용하여 사용자 취향에 기반한 레시피 추천 플랫폼을 제작한 경험이 있습니다. 저는 Django에서 컨텐츠 기반 필터링을 사용하여 연관레시피를 추천해주는 기능 구현을 담당하였습니다. Python을 사용하여 크롤링을 통해 5000여 개의 레시피 데이터를 가져왔으며, 7만여 개의 리뷰 데이터를 가공하였습니다.\n\n컨텐츠 기반 필터링을 사용하여 비슷한 재료로 만들 수 있는 레시피를 추천하는 기능을 구현하는 데에 성공하였지만, 문제가 발생하였습니다. 해당 데이터를 받아오는데 10초가량 걸리면서 서비스를 이용하는 데 불편함이 있다는 것이었습니다. 원인을 파악하기 위해 코드를 한줄씩 실행시키며 테스트를 진행하였습니다. 그 결과, 데이터를 받아오는데 오래 걸리는 원인은 query에 있었습니다. 리뷰 데이터가 7만여개 다보니 성능을 저하시키는 주 원인이었고 , 5개의 테이블이 한꺼번에 조인되면서 query의 성능이 급격히 저하 되었습니다. 따라서 리뷰 테이블과 레시피-해시태그-재료-재료이름 4개의 테이블을 조인하여 따로 불러왔으며 필요한 컬럼으로만 구성하였습니다. 데이터를 받아오는 데에 10초가 걸리던 API가 3초로 줄어들게 되었습니다. 시간은 단축되었지만, 초반 DB 설계 시 반복적인 조인을 줄이기 위해 반정규화를 진행하였다면 시간이 좀 더 절약됐을 것 같다는 아쉬움이 남았습니다.','프로그램 개발, 알고리즘 풀이 등 SW개발 관련 경험 중 가장 어려웠던 경험과 해결방안에 대해 구체적으로 서술하여 주시기 바랍니다. (과제 개요, 어려웠던 점, 해결방법, 결과 포함)',1),(2,'토스','싸움 났는데 주먹으로 해결했습니다.','팀 프로젝트시 어려움을 겪었던 상황과 해결한 방법을 기술하시오.',2),(3,'삼성','이 회사 너무 잘 나가서요','삼성전자를 지원한 이유와 입사 후 회사에서 이루고 싶은 꿈을 기술하십시오.',3),(9,'KT','[신중함이 불러온 갈등]\n\n2009년 교내 동아리의 회장을 맡게 되었습니다. 동아리 초반 행사 순서에 대한 의견 차이로 진행이 어렵게 되었습니다. 저는 계획에 대한 빠른 결정을 내리지 못해 갈등만 깊어졌습니다. 큰 책임감을 느낀 저는 먼저 행동하고 고민했습니다. 그리고 직접 운영진들을 찾아가 의견공유를 하였습니다. 결국, 모두의 의견을 하나로 모을 수 있었고 행사도 진행할 수 있었습니다. 이 경험을 바탕으로 조직 활동에서 때로는 신속하고 적극적인 자세가 필요하다는 것을 배울 수 있었습니다. 그리고 이 같은 실수를 다시 범하지 않겠다고 다짐했습니다.\n\n[빠른 판단으로 이룬 성공]\n\n2012년 가을 창업 공모전에 참가하면서 다시 어려움을 겪었습니다. 화장품 업체와 연계한 특강 `美-project`를 진행하면서 홍보 역할을 수행했습니다. 교내에서 진행되는 프로그램인 만큼 100명 이상의 예매가 필요했습니다. 그러나 인형 탈도 쓰고, 피자도 나눠줬지만, 현장에서의 홍보는 바쁜 학생들 사이에서 효과적이지 않았습니다.\n\n기회를 찾은 것은 학교 커뮤니티에 많은 학생이 방문한다는 것을 알게 되었을 때입니다. 저는 빠른 판단으로 현장 홍보를 포기하고, 게시글에 댓글을 등록하는 사람 중 선물을 증정할 것을 제안했습니다. 또한, 온라인 할인을 통해 예매율을 높이려 했습니다. 그 결과 150명이 예매를 했고 강연회는 성공할 수 있었습니다.\n\n일을 처리하는 데 있어 신중함과 꼼꼼함이 필요합니다. 그러나 때로는 신속하고 도전적인 판단이 필요합니다. 저는 어려움을 극복하면서 갈등과 위기를 돌파하는 적극적인 자세를 배울 수 있었습니다.','내가 어떻게 살아왔는지 설명해줘',8),(11,'삼성','[학과 학생회 홈페이지 프로젝트 진행]\n 학과 학생회를 운영하며 아쉬웠던 점은 업무 관리가 수동으로 진행되고, 학생회 커뮤니티가 없다는 점이었습니다. 이러한 점을 해소하고자 방학에 4명의 팀원을 구해 총 5명의 팀을 꾸려 학생회 홈페이지를 서버 구축부터 시작하여 구현하는 프로젝트를 진행하였습니다. 팀원들이 함께 백엔드에서는 node.js 프론트엔드에서는 유망기술인 vue.js를 사용하여 프로젝트를 시작했습니다.\n \n [학부생 5명의 한계]\n 처음 기획에는 모두가 잘 참여하여 대략적인 개요가 완성되었고, 개발 초기에는 각자의 지식을 합쳐 개발하여 순조로웠습니다. 하지만 곧 난관에 봉착했는데, 전문가가 없이 학부생만으로 구성된 팀이었기 때문에 지식에 대한 부족함이 첫 난관이었습니다. 두 번째 난관은 개발 역량 외에도 팀원들의 의지도 점점 줄어들었는데, 방학에 진행된 프로젝트였기 때문에 의지를 가지고 시작한 처음과는 달리 느슨해졌고, 일정이 늘어지게 되는 것이었습니다.','가장 열정적으로 한 프로젝트에 대해서 소개헤주세요',1),(12,'삼성전자','너우 어려워용','가장 어려웠던 개발 경험에 대해서 설명해주세요',10),(13,'네이버','테스트','테스트',10),(16,'네이버','저에게 있어서 가장 열정을 가지고 임했던 프로젝트는 대학 시절 참여한 \"자율주행 자동차 프로젝트\"입니다. 이 프로젝트는 실제 도로 환경에서 자율주행 기술을 구현하고 검증하는 것을 목표로 하였습니다.\n\n우리 팀은 프로젝트의 초기 단계부터 참여하여, 먼저 자율주행 알고리즘 및 센서 기술 등을 연구하고 구현하는 데에 많은 시간을 투자했습니다. 저는 특히 주행 경로 계획 알고리즘을 개발하는 과정에서 주도적으로 참여하였습니다. 우리 팀은 ROS(Robot Operating System)를 기반으로 한 차량 제어 시스템을 설계하고 구축하였으며, 실시간으로 센서 데이터를 수집하고 분석하여 주행 경로를 동적으로 계획하는 알고리즘을 개발하였습니다.\n\n프로젝트의 수행 과정에서는 많은 어려움과 도전이 있었습니다. 예상치 못한 하드웨어 및 소프트웨어 문제로 인해 여러 차례의 실패와 수정이 있었지만, 우리 팀은 이러한 도전에 긍정적으로 대처하여 해결책을 찾아나갔습니다. 끊임없는 실험과 개선을 통해 점차적으로 프로젝트의 성과를 높여나갔습니다.\n\n결과적으로, 저희 팀은 자율주행 자동차를 성공적으로 개발하고 시험 주행을 완료하였습니다. 실제 도로 환경에서도 안전하게 주행하는 것을 확인하여 프로젝트를 성공적으로 마무리할 수 있었습니다. 이 경험을 통해 저는 문제 해결 능력과 협업 능력을 키울 수 있었으며, 기술적인 도전에 대한 열정과 해결의지를 더욱 키울 수 있었습니다. 이러한 경험을 바탕으로 네이버에서의 개발 업무에 적극적으로 참여하고 성과를 이끌어내고자 합니다.','가장 열정을 가지고 임했던 프로젝트(목표/과제 등)를 소개해 주시고, 해당 프로젝트의 수행 과정 및 결과에 대해 기재해 주세요.',5),(17,'신한은행','[연계대출 서비스 개발]\n\n 스타트업에서 인턴으로 근무하던 당시 Python과 Django 프레임워크를 사용해 연계 대출 서비스를 개발하는 프로젝트의 백엔드 개발을 담당하여 수행한 경험이 있습니다. 연계 대출 서비스는 대출 신청자 중 심사 단계에서 거절된 고객이나 스스로 이탈한 고객에게 타 은행의 대출 상품을 연계해주는 서비스였습니다. 저는 조건에 부합하는 고객의 데이터를 분석하여 문자메시지 및 이메일을 발송하고 렌딩 페이지로 연결되도록 하는 로직을 구현했습니다. 또한, 각 단계별 고객의 Action에 대한 데이터를 쌓는 작업을 수행했습니다. 킥오프 미팅부터 테스트 및 배포까지 대략 6주 정도의 기간이 소요되었습니다. 이러한 경험으로 데이터 분석을 통해 서비스를 개발하여 회사의 이익을 창출하는 과정을 직접 경험해볼 수 있었습니다. \n \n [페이스북 API를 통한 광고 자동화]\n\n  이 외에도 Python과 Django 및 Pandas 라이브러리를 이용하여 광고의 효율성을 점검하고 자동으로 광고를 내려주는 프로그램을 구현한 경험이 있습니다. 기존에는 마케팅 부서에서 일정 주기로 광고의 비용과 유입량 등을 조사하고 수작업을 통해 광고를 관리했습니다. 이를 자동화하기 위해 회사 계정의 페이스북 비즈니스 API 토큰을 발급받고 이를 통해 광고 인사이트를 가져오는 코드를 작성했습니다. 가져온 데이터를 분석한 뒤 광고의 효율성을 계산하는 기준을 정하기 위해 마케팅 부서와 회의를 진행했습니다. 그리고 광고 비용 대비 유입량, 클릭 수 등을 조합하여 일정한 기준을 정하고 2시간 마다 자동으로 이를 계산하여 광고를 꺼주도록 하는 프로그램을 개발했습니다. 또한, 어떤 광고가 꺼졌는지 Slack을 통해 알려주도록 구현했습니다. 이후 테스트 과정을 거치고 검증을 마친 후에 크론탭에 등록하여 자동화 작업을 완료했습니다. 개발 완료까지 대략 5주의 기간이 소요되었으며 이를 통해 자동화 작업이 업무의 효율성을 얼마나 향상시킬 수 있는지 확인할 수 있었습니다.','4. 본인이 수행한 디지털/ICT 관련 프로젝트와 업무 경험(경력 포함)을 모두 기술해 주세요.\n 단, 프로젝트 및 업무의 내용, 기간, 본인의 역할, 사용언어 및 프로그램 등을 구체적으로 작성해 주세요. (최대 1,000자 입력가능)',5),(18,'네이버','저에게 있어서 가장 열정을 가지고 임했던 프로젝트는 대학 시절 참여한 \"자율주행 자동차 프로젝트\"입니다. 이 프로젝트는 실제 도로 환경에서 자율주행 기술을 구현하고 검증하는 것을 목표로 하였습니다.\n\n우리 팀은 프로젝트의 초기 단계부터 참여하여, 먼저 자율주행 알고리즘 및 센서 기술 등을 연구하고 구현하는 데에 많은 시간을 투자했습니다. 저는 특히 주행 경로 계획 알고리즘을 개발하는 과정에서 주도적으로 참여하였습니다. 우리 팀은 ROS(Robot Operating System)를 기반으로 한 차량 제어 시스템을 설계하고 구축하였으며, 실시간으로 센서 데이터를 수집하고 분석하여 주행 경로를 동적으로 계획하는 알고리즘을 개발하였습니다.\n\n프로젝트의 수행 과정에서는 많은 어려움과 도전이 있었습니다. 예상치 못한 하드웨어 및 소프트웨어 문제로 인해 여러 차례의 실패와 수정이 있었지만, 우리 팀은 이러한 도전에 긍정적으로 대처하여 해결책을 찾아나갔습니다. 끊임없는 실험과 개선을 통해 점차적으로 프로젝트의 성과를 높여나갔습니다.\n\n결과적으로, 저희 팀은 자율주행 자동차를 성공적으로 개발하고 시험 주행을 완료하였습니다. 실제 도로 환경에서도 안전하게 주행하는 것을 확인하여 프로젝트를 성공적으로 마무리할 수 있었습니다. 이 경험을 통해 저는 문제 해결 능력과 협업 능력을 키울 수 있었으며, 기술적인 도전에 대한 열정과 해결의지를 더욱 키울 수 있었습니다. 이러한 경험을 바탕으로 네이버에서의 개발 업무에 적극적으로 참여하고 성과를 이끌어내고자 합니다.\n\n 가장 열정을 가지고 임했던 프로젝트(목표/과제 등)를 소개해 주시고, 해당 프로젝트의 수행 과정 및 결과에 대해 기재해 주세요.','갈등 상황을 해결한 경험',8),(19,'카카오','카카오도 매우 잘나가서요','소분류 질문',3);
